  KEY `sys_user_organization_organization_id` (`organization_id`),
  CONSTRAINT `sys_user_organization_organization_id` FOREIGN KEY (`organization_id`) REFERENCES `sys_organization` (`id`),
  CONSTRAINT `sys_user_organization_user_id` FOREIGN KEY (`user_id`) REFERENCES `sys_user` (`id`)
